--MERGESORT

--SEQUENTIAL VERSION
smergesort :: (Ord a) => [a] -> [a]

smergesort [] = []
smergesort [single] = [single]
smergesort lst = merge (smergesort leftHalf) (smergesort rightHalf)
                  where leftHalf = take (div (length lst) 2) lst
                        rightHalf = drop (div (length lst) 2) lst

--PARALLEL VERSION
mergesort :: (Ord a) => Integer -> [a] -> [a]

mergesort 0 lst = smergesort lst --do sequential once you get 0
mergesort _ [] = []
mergesort _ [single] = [single]
mergesort d lst = let mergesort1 = (mergesort (d-1)) $ take (div (length lst) 2) lst
                      mergesort2 = (mergesort (d-1)) $ drop (div (length lst) 2) lst
                  in
                    par mergesort1 (pseq mergesort2 (merge mergesort1 mergesort2) )

merge :: (Ord a) => [a] -> [a] -> [a]
merge lList [] = lList
merge [] rList = rList
merge (lhead : ltail) (rhead : rtail)
    | lhead <= rhead = lhead : merge ltail (rhead:rtail)
    | otherwise      = rhead : merge (lhead:ltail) rtail


--QUICKSORT

--SEQUENTIAL
squicksort :: (Ord a) => [a] -> [a]

squicksort [] = []
squicksort (pivot:xs) = (squicksort lesserPart) ++ [pivot] ++ (squicksort greaterPart)
    where
        lesserPart = filter (<= pivot) xs
        greaterPart = filter (> pivot) xs

--PARALLEL
quicksort :: (Ord a) => Integer -> [a] -> [a]

quicksort 0 lst = squicksort lst
quicksort _ [] = []
quicksort d (pivot:xs) = par lesserPart (pseq greaterPart ((quicksort (d-1)) lesserPart ++ [pivot] ++ (quicksort (d-1)) greaterPart))
    where
        lesserPart = filter (<= pivot) xs
        greaterPart = filter (> pivot) xs


--TIME DIFF CALCULATING FUNC
secDiff (TOD secs1 psecs1) (TOD secs2 psecs2) = fromInteger ( psecs1 - psecs2) / 1e12 + fromInteger (secs1 - secs2)

